import axios from 'axios';

const api = axios.create({
  baseURL: 'http://127.0.0.1:8000/api',
});

export function fetchCommunities() {
  return axios.get(`${BASE_URL}/community/list`);
}

export function fetchCommunityKeywords(communityId) {
  return axios.get(`${BASE_URL}/community/keywords/${communityId}`);
}

export function fetchCommunityPagerank() {
  return axios.get(`${BASE_URL}/community/pagerank`);
}
